import React from 'react';
import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Route
} from 'react-router-dom'
import ArticleContainer from './containers/ArticleContainer';
function App() {
  return (
    <div className="App">
      <Router>
          <Route exact path='/articles' render={() => <ArticleContainer />}/>
      </Router>
    </div>
  );
}

export default App;
